import sys
from PyQt5.QtWidgets import QApplication, QWidget, QLabel, QPushButton, QVBoxLayout, QHBoxLayout, QFileDialog, QTextEdit, QScrollArea
from PyQt5.QtCore import QThread, pyqtSignal, Qt, QByteArray
from PyQt5.QtGui import QIcon, QPixmap, QImage
from alright import WhatsApp
import time
import datetime
import base64

class WhatsAppSender(QWidget):
    def __init__(self):
        super().__init__()

        self.setWindowTitle("WhatsApp Рассылка")
        self.setGeometry(100, 100, 550, 550)

        # Запрет изменения размеров окна
        self.setFixedSize(self.size())

        # Устанавливаем иконку
        icon_data = b''
        icon = QIcon(QPixmap.fromImage(QImage.fromData(QByteArray.fromBase64(icon_data))))
        self.setWindowIcon(icon)

        # Главный вертикальный контейнер
        main_layout = QVBoxLayout(self)

        # Поля для выбора файла с контактами и ввода сообщения
        self.contact_file_label = QLabel("Выберите файл с контактами:")
        main_layout.addWidget(self.contact_file_label)

        # Horizontal layout for the file entry and browse button
        file_layout = QHBoxLayout()

        self.contact_file_entry = QTextEdit()
        self.contact_file_entry.setFixedHeight(30)
        self.contact_file_entry.setReadOnly(True)
        file_layout.addWidget(self.contact_file_entry)

        self.browse_button = QPushButton("Обзор", clicked=self.browse_contacts)
        file_layout.addWidget(self.browse_button)

        main_layout.addLayout(file_layout)

        self.message_label = QLabel("Введите сообщение:")
        main_layout.addWidget(self.message_label)

        self.message_entry = QTextEdit()
        self.message_entry.setFixedHeight(100)
        main_layout.addWidget(self.message_entry)

        # Поле для отображения логов
        self.log_label = QLabel("Логи:")
        main_layout.addWidget(self.log_label)

        # Создаем виджет для логов и добавляем его в область прокрутки
        self.log_display = QTextEdit()
        self.log_display.setFixedHeight(150)
        self.log_display.setReadOnly(True)
        # log_scroll_area = QScrollArea()  # Закомментируйте или удалите эту строку
        # log_scroll_area.setWidgetResizable(True)  # Закомментируйте или удалите эту строку
        # log_scroll_area.setWidget(self.log_display)  # Закомментируйте или удалите эту строку
        main_layout.addWidget(self.log_display)
        # main_layout.addWidget(log_scroll_area)  # Закомментируйте или удалите эту строку

        # Кнопка начать рассылку
        self.start_button = QPushButton("Начать рассылку", clicked=self.start_send)
        main_layout.addWidget(self.start_button)

        # Добавляем две метки с текстами
        instruction_text1 = "Нажимая кнопку 'Начать рассылку' начнется отправка сообщений."
        instruction_text2 = "Не закрывайте программу - до окончания рассылки"

        self.instruction_label1 = QLabel(instruction_text1)
        main_layout.addWidget(self.instruction_label1)

        self.instruction_label2 = QLabel(instruction_text2)
        main_layout.addWidget(self.instruction_label2)

        # Копирайт
        copyright_layout = QHBoxLayout()
        self.copyright_label = QLabel("© 2023 King Triton")
        copyright_layout.addWidget(self.copyright_label, alignment=Qt.AlignLeft)

        # Добавляем ссылку на GitHub
        github_link = QLabel('<a href="https://github.com/king-tri-ton/wa-sender-en">GitHub</a>')
        github_link.setOpenExternalLinks(True)
        copyright_layout.addWidget(github_link, alignment=Qt.AlignRight)

        main_layout.addLayout(copyright_layout)

        # Инициализация переменной для отслеживания состояния рассылки
        self.sending_in_progress = False

    def browse_contacts(self):
        file_path, _ = QFileDialog.getOpenFileName(self, "Выберите файл с контактами", "", "Текстовые файлы (*.txt)")
        self.contact_file_entry.setPlainText(file_path)

    def start_send(self):
        # Проверяем, выполняется ли уже рассылка
        if self.sending_in_progress:
            return

        contacts_file = self.contact_file_entry.toPlainText()
        message = self.message_entry.toPlainText().strip()

        self.log_display.setPlainText("")

        if not contacts_file or not message:
            self.log_display.insertPlainText("Ошибка: Заполните все поля\n")
            return

        # Обновляем заголовок окна
        self.setWindowTitle("WhatsApp Рассылка (Отправка сообщений...)")

        # Запись о начале рассылки в логи
        start_time = datetime.datetime.now().strftime("%d.%m.%Y %H:%M")
        start_log_message = f"Рассылка началась [{start_time}]\n"
        self.log_display.append(start_log_message)

        # Блокируем кнопки "Обзор" и "Начать рассылку"
        self.browse_button.setEnabled(False)
        self.start_button.setEnabled(False)

        # Блокируем поле с сообщением
        self.message_entry.setReadOnly(True)

        # Устанавливаем флаг, что рассылка начата
        self.sending_in_progress = True

        # Запускаем задачу в отдельном потоке
        self.sender_thread = SenderThread(contacts_file, message, start_time)
        self.sender_thread.log_update.connect(self.update_log_display)
        self.sender_thread.finished.connect(self.update_interface)
        self.sender_thread.start()

    def closeEvent(self, event):
        # Перехватываем событие закрытия окна
        if self.sending_in_progress:
            # Если рассылка в процессе, завершаем поток перед закрытием окна
            self.sender_thread.quit()
            self.sender_thread.wait()

        event.accept()

    def update_log_display(self, message):
        self.log_display.append(message)

    def update_interface(self):
        # Разблокируем кнопки "Обзор" и "Начать рассылку"
        self.browse_button.setEnabled(True)
        self.start_button.setEnabled(True)

        # Разблокируем поле с сообщением
        self.message_entry.setReadOnly(False)

        # Устанавливаем флаг, что рассылка завершена
        self.sending_in_progress = False

        # Обновляем заголовок окна
        self.setWindowTitle("WhatsApp Рассылка")

class SenderThread(QThread):
    log_update = pyqtSignal(str)
    finished = pyqtSignal()

    def __init__(self, contacts_file, message, start_time):
        super().__init__()
        self.contacts_file = contacts_file
        self.message = message
        self.start_time = start_time

    def run(self):
        try:
            # Инициализируем экземпляр alright
            messenger = WhatsApp()

            # Отправляем сообщение для каждого контакта из файла
            with open(self.contacts_file, 'r') as file:
                contacts = file.readlines()
                for contact in contacts:
                    contact = contact.strip()
                    if contact:
                        # Ищем пользователя
                        messenger.find_user(contact)

                        # Send the message
                        messenger.send_message(self.message)

                        # Отправляем сообщение
                        self.log_update.emit(f"\nСообщение отправлено контакту {contact}")

                        # Поддерживаем задержку между сообщениями (необязательно)
                        time.sleep(3)

        except Exception as e:
            self.log_update.emit(f"\nОшибка: {str(e)}")

        finally:
            # Запись о завершении рассылки в логи
            end_time = datetime.datetime.now().strftime("%d.%m.%Y %H:%M")
            end_log_message = f"\nРассылка завершена [{end_time}]\n"
            self.log_update.emit(end_log_message)

            # Завершаем alright, чтобы освободить ресурсы
            messenger.quit()

            self.finished.emit()

if __name__ == "__main__":
    app = QApplication(sys.argv)
    window = WhatsAppSender()
    window.show()
    sys.exit(app.exec_())
